import React from 'react';

const HandleScreen = () => {
  return (
    <>
      { checkUserLogin !== null ? (
          <Tabar />
      )
      :
        <NavigationContainer >
        <RootScreen/> 
      </NavigationContainer>
    }
      
    </>
  );
};

export default HandleScreen;

const styles = StyleSheet.create({});
